<?php

namespace Fintech\Banco\Seeders;

use Fintech\Banco\Models\Bank;
use Fintech\Banco\Models\BankBranch;
use Illuminate\Database\Seeder;

class BankSeeder extends Seeder
{
    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        foreach ($this->data() as $bank_name => $data) {
            $bank = new Bank([
                'country_id' => 19,
                'beneficiary_type_id' => null,
                'bank_name' => $bank_name,
                'bank_category' => null,
                'transaction_type' => 'Account Deposit',
                'bank_currency' => 'BDT',
                'bank_data' => [],
                'enabled' => true,
            ]);

            $branches = [];

            array_walk($data, function($item) use(&$branches) {
               $branches[] = new BankBranch($item);
            });

            $bank->save();

            $bank->branches()->saveMany($branches);

            $this->command->line("Bank : {$bank_name} is done.");

        }
    }

